(function () { tinymce.PluginManager.add("downloadmanager", function (a) { a.addCommand("wp-cybertour-Insert_Download", function () { var b = jQuery.trim(prompt(tinymce.translate("Enter File ID (Separate Multiple IDs By A Comma)"))); null != b && "" != b && a.insertContent('[download id="' + b + '"]') }); a.addButton("downloadmanager", { text: !1, tooltip: tinymce.translate("Insert File Download"), icon: "downloadmanager dashicons-before dashicons-welcome-view-site", onclick: function () { tinyMCE.activeEditor.execCommand("wp-cybertour-Insert_Download") } }) }) })();